        <ul class="display:flex; justify-content:center;">

        </ul>
        <div style="display: flex; justify-content: center">
            <div>
                <button id="red" class="button-color">Red</button>
                <button id="blue" class="button-color">blue</button>
                <button id="yellow" class="button-color">yellow</button>
                <button id="green" class="button-color">green</button>
            </div>

            <div>
                <input type="color" id="secondary" name="secondary" value="#e66465">
                <label for="secondary">Secondary</label>
            </div>

            <div>
                <input type="color" id="tertiary" name="tertiary" value="#f6b73c">
                <label for="tertiary">Tertiary</label>
            </div>
        </div>
    </div>

    <script>
        const primary = document.querySelectorAll(".cls-9");

        const secondary = document.querySelectorAll(".secondary");
        const tertiaryFill = document.querySelectorAll(".tertiary");
        const tertiaryStroke = document.querySelectorAll(".tertiary-stroke");

        console.log(primary);
        const buttonColors = document.querySelectorAll(".button-color");
        buttonColors.forEach((button) => {
            button.addEventListener("click", () => {
                primary.forEach((div) => {
                    div.style.fill = button.id;
                });
            });
        });

        const secondaryColor = document.getElementById("secondary");

        secondaryColor.addEventListener("input", () => {
            const selectedColor = secondaryColor.value;

            secondary.forEach((div) => {
                div.style.fill = selectedColor;
            });
        });

        const tertiaryColor = document.getElementById("tertiary");

        tertiaryColor.addEventListener("input", () => {
            const selectedColor = tertiaryColor.value;

            tertiaryFill.forEach((div) => {
                div.style.fill = selectedColor;
                div.style.stroke = selectedColor;
            });

            tertiaryStroke.forEach((div) => {
                div.style.stroke = selectedColor;
            });
        });
    </script>
